function onClick_subtree(n){let t=document.getElementById(n).parentElement;$.ajax({url:"/FeatTree/GetChildren",method:"GET",data:{parent:n},accepts:"application/json",success:function(n){console.log(n);hideOtherFeats();createSubTree(t,n)}})}function hideOtherFeats(){}function createSubTree(n,t){let r=document.createElement("div");for(r.classList.add("row"),r.classList.add("feat-tree-area"),i=0;i<t.length;i++){let f=t[i],n=document.createElement("div");n.classList.add("col-md-3");n.classList.add("feat-tree-block");n.id=f.name;n.onclick="onClick_subtree(this.id)";let o=document.createElement("strong"),h=document.createTextNode(f.name);o.appendChild(h);let e=document.createElement("span");e.classList.add("link-img");let u=document.createElement("a");u.href=f.link;u.target="_blank";let s=document.createElement("img");s.src="/images/link.png";u.appendChild(s);e.appendChild(u);n.appendChild(o);n.appendChild(e);r.appendChild(n)}n.appendChild(r)}